import { Grid, ListItemButton, styled } from "@mui/material";
import { Colors } from "../theme";

export const LeftContactCard = styled(Grid)(({theme}) => ({
        padding:'20px',
        background: Colors.dim_grey,
        '& h4,& h5':{
            color:Colors.secondary,
            fontWeight:600,
        },
        '& h5':{
            color:Colors.white,
            fontWeight:600,
        },
        '& > span':{
            color:Colors.light_gray,
        }

}));

export const StyledListButton = styled(ListItemButton)(({theme}) => ({
        display:'flex',
        alignItems:'center',
        '&  span':{
            color:Colors.white,
        },
        '& .MuiSvgIcon-root':{
            color:Colors.primary,
        }

}));

