export const styledListButton2 = {
    display:'flex',
    alignItems:'center',
    '& .MuiSvgIcon-root':{
        color:Colors.white,
        background:Colors.primary,
        padding:'15px',
        transition:'.4s',
        marginRight:'10px'
    },
    '& .MuiSvgIcon-root:hover':{
        color:Colors.primary,
        background:Colors.white,
        transform: 'rotate(360deg)',
    }
}
